const ScrollUpStyle = {
	scroll: {
	  opacity: "0.3",
	  backgroundColor: "aqua",
	  width: "40px",
	  height: "40px",
	  position: "fixed",
	  bottom: "10px",
	  right: "10px",
	  borderRadius: "5px",
	  border: "none",
	  '&:hover': {
	    opacity: 1
	  }
	}
}

export default ScrollUpStyle;
